import React, { useState } from "react";

function SearchResultList() {
  const [selected, setSelected] = useState(null);

  const handleClick = (word) => {
    setSelected(word);
  };

  return (
    <div style={{ display: "flex", flexDirection: "row" }}>
      <div style={{ marginRight: "10px" }}>
        <a href="#" onClick={() => handleClick("hotel")}>
          Tampilkan list hotel
        </a>
        {selected === "hotel" && (
          <ul>
            <li>Hotel A</li>
            <li>Hotel B</li>
            <li>Hotel C</li>
          </ul>
        )}
      </div>
      <div>
        <a href="#" onClick={() => handleClick("pantai")}>
          Tampilkan list pantai
        </a>
        {selected === "pantai" && (
          <ul>
            <li>Pantai X</li>
            <li>Pantai Y</li>
            <li>Pantai Z</li>
          </ul>
        )}
      </div>
    </div>
  );
}

export default s
